import React, {useEffect, useMemo, useRef, useState} from "react";
import "./styles/App.css";
import {BrowserRouter, Route} from "react-router-dom";
import About from "./pages/About";

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <Route path="/about">
                    <About/>
                </Route>
            </BrowserRouter>
        </div>
    )
}

export default App;
